  [],\n\t\"revision_timestamp\": \"2015-09-27T01:47:57.366836\",\n\t\"name\": \"environmental-sensitivity-index-esi-atlas-northern-california-maps-and-geographic-information-s\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set comprises the Environmental
  Sensitivity Index (ESI) maps for the shoreline of northern California which were
  designed to be utilized in desktop GIS systems. ESI data characterize coastal environments
  and wildlife by their sensitivity to spilled oil. The ESI data include information
  for three main components: shoreline habitats; sensitive biological resources; and
  human-use resources. This Atlas was compiled from geographical and biological data
  with multiple dates; the intertidal habitats were mapped during aerial and ground
  surveys conducted from 20-26 October 1992, and biological and human-use resources
  data were compiled by regional biologists in 1994. The dates for the original data
  and methodology are completely documented in within the included FGDC metadata file
  \"METADATA.PDF\" and document \"INTRO.PDF\". A set of associated .PDF maps are also
  included.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
